import React from 'react';

const SelectTimeSlot = ({ setTimeSlot, prevStep }) => {
    const handleTimeSlotSelection = (timeSlot) => {
        setTimeSlot(timeSlot);
    };

    return (
        <div>
            <h2>Select a Time Slot</h2>
            <button onClick={() => handleTimeSlotSelection('10:00 AM')}>10:00 AM</button>
            <button onClick={() => handleTimeSlotSelection('02:00 PM')}>02:00 PM</button>
            <button onClick={prevStep}>Back</button>
        </div>
    );
};

export default SelectTimeSlot;
